import React from 'react';
import '../pages/styles/Workouts.css';

const Workouts = () => {
  const workouts = [
    {
      category: 'Cardio',
      items: ['Running', 'Cycling', 'Jump Rope'],
    },
    {
      category: 'Strength',
      items: ['Weight Lifting', 'Bodyweight Exercises', 'Resistance Bands'],
    },
    {
      category: 'Yoga',
      items: ['Hatha Yoga', 'Vinyasa Yoga', 'Power Yoga'],
    },
  ];

  return (
    <div className='workouts-container'>
      <div className='header-workouts'>
        <h1>Workouts</h1>
        <p>Explore a variety of exercises to suit your fitness goals.</p>
      </div>

      <div className='workouts-categories'>
        {workouts.map((workout, index) => (
          <div className='workout-card' key={index}>
            <h2>{workout.category}</h2>
            <ul>
              {workout.items.map((item, idx) => (
                <li key={idx}>{item}</li>
              ))}
            </ul>
          </div>
        ))}
      </div>
    </div>
  );
};

export default Workouts;
